import React from "react";
import "./App.css";

function App() {
  return (
    <React.Fragment>
      <div className="App">
        <header className="App-headers">Covid19 Tracker</header>
      </div>
      <div className="search-box">
        <input type="search"></input>
      </div>
    </React.Fragment>
  );
}

export default App;
